import React, {useState, useEffect, useContext} from 'react'
import axios from "axios"
import {preventDefault} from "react"
import {useNavigate} from "react-router-dom"


export default function Table({url}) {

    const history =useNavigate()
    const shorturlHandler= async (e)=>{
        e.preventDefault();
        try{
            
            console.log("clickedd")
            console.log(url)
            await axios.get("shorturls/get/"+url.short)
            history("/"+url.full)
            
        }
        catch(err){
            console.log(err)
        }
    }

  return (
            <tr scope="row"> 
                
                <td >
                <a href={url.full}>{url.full}</a>
                </td>
                <td><a onClick={shorturlHandler} href={url.short}>{url.short}</a></td>
                <td>{url.clicks}</td>
            
            </tr>
  )
}
